TWComponent.script:
if (tw.local.results){
tw.local.htmlResult = tw.local.results.toXMLString();
}
if (tw.local.htmlResult && tw.local.htmlResult.indexOf(tw.local.WebServerConfig.ValidationText) != -1) {
tw.local.WebServerStatusMessage = "Success: DB Connection Invocation and validation Passed " + new TWDate();
}else {
tw.local.WebServerStatusMessage = "Error: DB validation did not succeed" + new TWDate();
}

if (tw.system.error){
tw.local.htmlResult = tw.system.error.toString(true);
}

